- input: TEXT,F3XA,,"The Fairfax County Democratic Committee - Federal, does not employ
    any staff at any wage.  No other employer provides paid staff to the use of the
    Fairfax County Democratic for a portion of their work day. The Committee in 2005
    financed political activities in connection with non Federal elections only. There
    were no elections involving Federal candidates in 2005. Administrative expenses
    of the Committee are paid solely (100 percent) with Federal funds. No allocation
    from the non-Federal account is used for any administrative expenses of the committee.This
    is an all volunteer committee.  No in kind contributions were received or reported
    for this reporting period. This amended report updates the employer and occupation
    of donors who provided the information to the Committee after the original filing
    of this report. "
